    /**
     * 判断是否有脏词
     * 
     * @param msg
     * @return
     */
    public static boolean hasDirtyWord(String msg) {
        if (StringUtils.isEmpty(msg)) {
            return false;
        }

        for (String dirtyWorld : filthyWords) {
            if (msg.contains(dirtyWorld)) {
                return true;
            }
        }

        return TextFilter2.hasDirtyWord(msg);
    }

    private static final String[] shieldedWord1 = { "功勋", "宝石", "兵", "科技", "我", "你", "他", "女", "是" };
    private static final String[] shieldedWord2 = { "出售", "刷", "卖", "元", "q点", "q币", "Q币", "Q点", "妈", "马", "操", "草", "擦", "媽", "孙子", "龟孙子", "龟儿子" };

    public static boolean hasShieldedWord(String msg) {
        if (StringUtils.isEmpty(msg)) {
            return false;
        }

        boolean has = false;
        for (String word : shieldedWord1) {
            if (msg.contains(word)) {
                has = true;
                break;
            }
        }

        boolean has2 = false;
        for (String word : shieldedWord2) {
            if (msg.contains(word)) {
                has2 = true;
                break;
            }
        }

        return has && has2;
    }

    public static String filter(String message, long userId) {
        if (StringUtils.isEmpty(message)) {
            return message;
        }

        for (String filthyWorld : filthyWords) {
            message = message.replaceAll(filthyWorld, "*");
        }

        return message;
    }

